是“情溢南洋”，象征着“隆诗”两人情定在拥有浪漫景致的巴厘岛，菜色有烤北海道<a href="http://m.so.com/s?q=%E6%89%87%E8%B4%9D&amp;src=newstranscode" class="qkw">扇贝</a>、菜花泥和白松露油、鲑鱼鱼子酱、芝士(干酪)片、柠檬<a href="http://m.so.com/s?q=%E9%BB%84%E6%B2%B9%E6%B1%81&amp;src=newstranscode" class="qkw">黄油汁</a>;而第一道主菜则是<a href="http://m.so.com/s?q=%E6%B8%85%E8%92%B8%E7%9F%B3%E6%96%91%E9%B1%BC&amp;src=newstranscode" class="qkw">清蒸石斑鱼</a>、姜、米酒、鲜汤组成的“金玉满堂”。</p><p>接着间奏是“喜结连理”，再来是第二道主菜“一团和气”，献给宾客香味四溢的烤和牛、<a href="http://m.so.com/s?q=%E7%BA%A2%E7%83%A7%E6%B4%8B%E8%91%B1&amp;src=newstranscode" class="qkw">红烧洋葱</a>及蟹肉土豆泥。最后甜点有两道:“天长地久”以及“长相思守”，分别为巧克力炸点心、芝麻、朗姆酒以及红豆沙，就连酒类都有传奇波亚克红葡萄酒、白葡萄酒给宾客选择，可以说是每道菜都别具意义，每道菜名都祝福着吴奇隆与刘诗诗在<a href="http://m.so.com/s?q=%E7%88%B1%E6%83%85%E8%BF%99%E6%9D%A1%E8%B7%AF&amp;src=newstranscode" class="qkw">爱情这条路</a>上的坚定与坚毅。</p></div>  <footer>  <p class=tip_quick>文章内容由搜索引擎自动发现并显示为快照，不代表360新闻的立场和观点，<a target=_blank class=viewsource href="http://jiangsu.china.com.cn/html/ent/hot/4901413_1.html">查看原文</a></p>      </footer> </article> <section class=sohu_cy> <div id=SOHUCS sid='f72a1947bed61e04e158f455c20f9a1e'></div><script id=changyan_mobile_js charset="utf-8" src="http://changyan.sohu.com/upload/mobile/wap-js/changyan_mobile.js?client_id=cyrTywwWs&conf=prod_c56aa5a54e89138d855c5ca9b31470a0" ></script> </section>  <aside id="next-news"> <h3><em>吴奇隆刘诗诗婚礼</em>的其它新闻:</h3> <ul>    <li> <a href="/transcode?q=%E5%90%B4%E5%A5%87%E9%9A%86%E5%88%98%E8%AF%97%E8%AF%97%E5%A9%9A%E7%A4%BC&amp;pn=1&amp;pos=2&amp;m=4117d84f0cc1abfe5c079e0d3aabcd2df272cfe1&amp;u=http%3A%2F%2Fjiangsu.china.com.cn%2Fhtml%2Fent%2Fhot%2F4901067_1.html" data-pos="1"> <b>吴奇隆刘诗诗婚礼</b>晚宴菜单:七层蛋糕菜品"喜气" </a>   <li> <a href="/transcode?q=%E5%90%B4%E5%A5%87%E9%9A%86%E5%88%98%E8%AF%97%E8%AF%97%E5%A9%9A%E7%A4%BC&amp;pn=1&amp;pos=3&amp;m=2fce88a82bb9fa5afa3ac633941879e9469db6a0&amp;u=http%3A%2F%2Fcnews.chinadaily.com.cn%2F2016-03%2F21%2Fcontent_23987580.htm" data-pos="2"> <b>吴奇隆刘诗诗婚礼</b>袁弘当伴郎 与二姐重口味秀恩爱抢头条 </a>   <li> <a href="/transcode?q=%E5%90%B4%E5%A5%87%E9%9A